import React from 'react';
import './App.css';
import FilterableProductTable from './FilterableProductTable'

const PRODUCTS = [
  {id:1, category: "Sporting Goods", price: "$49.99", stocked: true, name: "Football"},
  {id:2, category: "Sporting Goods", price: "$49.99", stocked: true, name: "Football"},
  {id:3, category: "Sporting Goods", price: "$9.99", stocked: true, name: "Baseball"},
  {id:4, category: "Sporting Goods", price: "$29.99", stocked: false, name: "Basketball"},
  {id:5, category: "Electronics", price: "$99.99", stocked: true, name: "iPod Touch"},
  {id:6, category: "Electronics", price: "$399.99", stocked: false, name: "iPhone 5"},
  {id:7, category: "Electronics", price: "$199.99", stocked: true, name: "Nexus 7"},
  {id:8, category: "Sporting Goods", price: "$49.99", stocked: true, name: "Football2"},
];

function App() {
  return (
    <div className="App">
      <FilterableProductTable productsObject={PRODUCTS} />
    </div>
  );
}

export default App;
